schemaDefinition: "create or replace view UNIFIEDSS_USER_TERRITORY_SECURITY(\n\t\"\
  TerritorySysID\",\n\t\"UserID\",\n\t\"Department\",\n\t\"DepartSecurityFlag\"\n\
  ) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"TERRITORYSYSID\" as \"TerritorySysID\"\
  ,\n       CAST(\"USERID\" AS VARCHAR('random')) as \"UserID\",\n       \"Department\"\
  \ as \"Department\",\n       \"DepartSecurityFlag\" as \"DepartSecurityFlag\"\n\
  FROM\n  (SELECT \"TERRITORYSYSID\" as \"TERRITORYSYSID\",\n          \"ORIG_USERID\"\
  \  as \"USERID\",\n          \"Department\" as \"Department\",\n          \"BIN\"\
  \ as \"BIN\",\n          \"DepartSecurityFlag\" as \"DepartSecurityFlag\"\n   FROM\
  \ EDW_LS.SALES_SS_EM.TF_UNIFIEDSS_USER_TERRITORY_SECURITY)Projection_1;"
